import React from "react";

function GroupBox() {
  return (
    <span class="group-box">
      <span class="col-lg-9">
        <img
          class="img-fluid rounded mb-4 mb-lg-0"
          src="http://placehold.it/270x170"
          alt=""
        />
      </span>
    </span>
  );
}

export default GroupBox;
